function getAlbums(inurl) {
	  FB.api(inurl,function(response){
         //data will come in chunks. For now, let's just loop through and output.
         data = response.data;

         //is there a next page?
         var nextpage;
		 var prevpage;
		 var after;
		 var before;

		 if (response.paging) {
			nextpage = response.paging.next;
            prevpage = response.paging.previous;
			after = response.paging.cursors.after;
			before = response.paging.cursors.before;
         }

		 var gallery = "";
         if ( data ) {
            for ( var i=0; i<data.length; i++ ) {
               //Get the album cover photo
               try {
				  if ( i % 3 == 0 ) {
                     if ( i > 0 ) gallery += "</div>";
                     gallery += "<div class='fbAlbumRow'>";
                  }

				  var title = "";

				  if ( typeof(data[i].description) == "undefined" ) {
				     title = data[i].name;
    			  } else {
				     title = data[i].description;
				  }

                  gallery += "<div class='fbAlbumCover'><a href=\"?store=" + store + "&album=" + data[i].id + "\"><img src='https://graph.facebook.com/" + data[i].id  + "/picture' title=\"" + title + "\"  /></a><p><a href=\"?store=" + store + "&album=" + data[i].id + "\">" + data[i].name + "</a></p></div>";

				  if ( i == data.length ) {
                     gallery += "</div>";
                  }
               }
               catch(e){}
            }

			jQuery("#loader").hide();
			jQuery("#pagePhotoGallery").append(gallery);
			// jQuery("#pageFranchise").hide();
			// jQuery("#pagePhotoGallery").show();

			//Paging
      		var paging = "<br style='clear:both' /><div id='fbPaging'>";

 	  		if ( prevpage ) {
				paging += "<a href='?store=" + store + "&album=" + album + "&a_before=" + before + "'>< Previous Page</a>";
			}

			if ( nextpage ) {
				paging += "<a href='?store=" + store + "&album=" + album + "&a_after=" + after + "'>Next Page ></a>";
			}

			paging += "</div>";
			jQuery("#pagePhotoGallery").append(paging);
		}
	});
}

