$(document).ready(function() {

	 // alert("application.js loaded");

	// hide the content section by default to allow the effects
	// IDEA: move this to the stylesheet
	$('.contentSection, .fullContent').hide();

	// slide in transition
	switchPanesEnter();

	// add target _blank to outside links in location left navigation
	$('#pageLocations aside.Left ul.pageMenuNav li a:not([target])').each(function() {
		if (this.href.indexOf(location.hostname) == -1) {
			$(this).attr("target", "_blank");
		}
	});

	// slide out transition
	$('a:not(.pageFranchiseNav, #fbPaging > a, [target], .promoCalLink)').click(function() {
		var href = this.href;
		if (this.id == "fbClosePhotoslink" || $(this).attr("name") == "pagePhotoGallery" ) {
			sessionStorage.pg = "1";
		}
		if (this.href.indexOf(location.hostname) != -1) {
			switchPanesExit(href);
		}
	});

	// CIRCLE LOADER
	$(document).on('init.slides', function() {
		$('.loading-container').fadeOut(function() {
			$(this).remove();
		});
	});

	// HOME PAGE SLIDER
	$('#backslides').superslides({
		play: 7000,
		slide_speed: 'slow',
		slide_easing: 'easeInOutCubic',
		pagination: false,
		hashchange: false,
		scrollable: true, // Allow scrollable content inside slide
		classes: {
			preserve: 'noResize',
			nav: 'slides-navigation',
			container: 'slides-container',
			pagination: 'slides-pagination'
			}
	});

	//LOCATIONS NAV BAR
	$('a.pageFranchiseNav').click(function(e) {
		var pane = $(this).attr('name'),
			switchPanes = function(name) {
				if ($('div.contentSection > div:visible').attr('id') === name) {
						// we don't need to do anything if the alread-exapnded item is clicked
					return;
				}
				if ($('div.contentSection > div:visible').length > 0) {
					// do we need to close anything at all?
					$('div.contentSection > div:visible').slideUp('fast', function() {
							$('#' + name).delay(300).slideDown('slow');
					});
				} else {
					$('#' + name).slideDown('slow');
				}
			};

		switchPanes(pane);
		e.preventDefault();
	});

});

// functions
function switchPanesEnter() {
	var loc = location.pathname;
	if (loc.indexOf('locations') != -1) {
		var a_after = getParameterByName("a_after");
		var a_before = getParameterByName("a_before");
		var album = getParameterByName("album");
		var p_after = getParameterByName("p_after");
		var p_before = getParameterByName("p_before");
		if (a_after || a_before || album || p_after || p_before) {
			$('#pageFranchise').hide();
			$('#pagePhotoGallery').show();
		}
		if (sessionStorage.pg == "1") {
			$('#pageFranchise').hide();
			$('#pagePhotoGallery').show();
		}
		var p_sec = getParameterByName("p_sec");
		if (p_sec && $('#' + p_sec).length) {
			$('.contentSection > div:not(#' + p_sec + ')').hide();
			$('#' + p_sec).show();
		}
	}
	sessionStorage.pg = "0";
	$('.contentSection, .fullContent').delay(300).slideDown('slow', 'easeInOutCubic', function(){
	});
}

function switchPanesExit(href) {
	$('.contentSection, .fullContent').slideUp('fast', 'easeInOutCubic', function(){});
	var i				= setInterval(function(){}, 1000);
	clearInterval(i);
}

function onBlur(el) {
	if (el.value == '') {
		el.value = el.defaultValue;
	}
}

function onFocus(el) {
	if (el.value == el.defaultValue) {
		el.value = '';
	}
}

function getParameterByName(name) {
	name = name.replace(/[\[]/, "\\\[").replace(/[\]]/, "\\\]");
	var regexS = "[\\?&]" + name + "=([^&#]*)";
	var regex = new RegExp(regexS);
	var results = regex.exec(window.location.search);
	if(results == null) {
		return "";
	} else {
		return decodeURIComponent(results[1].replace(/\+/g, " "));
	}
}

