// --------------------------------------------------------------------

// Show the popup
// --------------------------------------------------------------------
Popup.prototype.show = function(options, modal) {
	this.modal = this.modal || (typeof(modal)=="boolean" && modal);
	if (defined(options) && options!=null && typeof(options)=="object") {
		for (var i in options) {
			this[i] = options[i];
		}
	}
	this.div = DOM.resolve(this.div);
	CSS.setStyle(this.div,'position','absolute');

	// If there is no div pre-defined to use, create one
	if (this.div==null) {
		this.div = this.createDiv();
	}
	if (this.content!=null) {
		this.div.innerHTML = this.content;
		this.content = null;
	}
	if (this.className!=null) {
		this.div.className = this.className;
	}
	if (this.style!=null) {
		this.applyStyle();
	}
	if (this.width!=null) {
		this.div.style.width = this.width+"px";
		this.div.style.overflowX="auto";
	}
	if (this.height!=null) {
		this.div.style.height = this.height+"px";
		this.div.style.overflowY="auto";
	}

	// Do the actual display - this is a separate method so display transitions can be implemented
	this.transition();

	// Make sure clicks on the DIV don't bubble up to the document
	this.div.onclick = function(e) { 
		Event.cancelBubble(Event.resolve(e));
	};
	this.div.onmouseup = this.div.onclick;

	// Focus to the DIV if possible	
	if (this.modal && this.div.focus) {
		this.div.focus();
	}
};

// Show the popup but make it modal
// --------------------------------------------------------------------
Popup.prototype.transition = function() {
	if (this.modal) {
		this.addScreen();
	}

	// Make the DIV displayed but hidden so its size can be measured
	CSS.setStyle(this.div,'visibility','hidden');
	CSS.setStyle(this.div,'display','block');

	// Position the popup
	this.setPosition();

	// Add the shim if necessary	
	if (this.useIframeShim) {
		this.addIframeShim();
	}

	// Make sure the DIV is higher than the shim
	this.div.style.zIndex = Popup.minZIndex++;

	CSS.setStyle(this.div,'display','block');
	CSS.setStyle(this.div,'visibility','visible');
};

// Show the popup but make it modal
// --------------------------------------------------------------------
Popup.prototype.showModal = function(options) {
	this.show(options,true);
};

// Apply user styles to the DIV
// --------------------------------------------------------------------
Popup.prototype.applyStyle = function() {
	if (this.div!=null && this.style!=null && typeof(this.style)=="object") {
		for (var i in this.style) {
			this.div.style[i] = this.style[i];
		}
	}
};

// Hide the popup
// --------------------------------------------------------------------
Popup.prototype.hide = function() {
	// If this was a temp object creating on-the-fly, then remove objects from the DOM so
	// The document doesn't get littered with extra objects
	if (this.destroyDivOnHide) {
		DOM.removeNode(this.div);
		this.div = null;
		delete Popup.objects[this.id];
	}
	else if (this.div!=null) {
		CSS.setStyle(this.div,'display','none');
	}

	if (this.destroyObjectsOnHide) {
		DOM.removeNode(this.iframe);
		DOM.removeNode(this.screen);
		DOM.removeNode(this.screenIframeShim);
	}
	else {
		if (this.iframe!=null) {
			this.iframe.style.display = "none";
		}
		if (this.screen!=null) {
			this.screen.style.display = "none";
		}
		if (this.screenIframeShim!=null) {
			this.screenIframeShim.style.display = "none";
		}
	}
};

// Util funcs for position
// --------------------------------------------------------------------
Popup.prototype.setTop = function(top) {
	this.div.style.top = top+"px";
};
Popup.prototype.setLeft = function(left) {
	this.div.style.left = left+"px";
};
Popup.prototype.getTop = function() {
	return parseInt(CSS.getStyle(this.div,"top"),10);
};
Popup.prototype.getLeft = function() {
	return parseInt(CSS.getStyle(this.div,"left"),10);
};

// All the logic to position the popup based on various criteria
// --------------------------------------------------------------------
Popup.prototype.setPosition = function() {
	if (this.position!=null) {
		var m = this.position.match(/^(\S+)\s+(\S+)/); 
		if (m!=null && m.length==3) {
			var v = m[1];
			var h = m[2];

			var ref = this.reference;
			if (ref==null) { ref = Screen.getBody(); }
			var p = Position.get(ref);
			var refTop = p.top;
			var refLeft = p.left;
			var refWidth = DOM.getOuterWidth(ref);
			var refHeight = DOM.getOuterHeight(ref);

			var width = DOM.getOuterWidth(this.div);
			var height = DOM.getOuterHeight(this.div);

			var scrollLeft = Screen.getScrollLeft();
			var scrollTop = Screen.getScrollTop();

			// Set vertical position relative to reference object
			if (v=="above") { this.setTop(refTop-height+this.offsetTop); }
			else if (v=="top") { this.setTop(refTop+this.offsetTop); }
			else if (v=="center") { this.setTop(refTop+(refHeight/2)-(height/2)+this.offsetTop); }
			else if (v=="bottom") { this.setTop(refTop+refHeight-height+this.offsetTop); }
			else if (v=="below") { this.setTop(refTop+refHeight+this.offsetTop); }

			// Set horizontal position relative to reference object
			if (h=="adjacent-left") { this.setLeft(refLeft-width+this.offsetLeft); }
			else if (h=="left") { this.setLeft(refLeft+this.offsetLeft); }
			else if (h=="center") { this.setLeft(refLeft+(refWidth/2)-(width/2)+this.offsetLeft); }
			else if (h=="right") { this.setLeft(refLeft+refWidth-width+this.offsetLeft); }
			else if (h=="adjacent-right") { this.setLeft(refLeft+refWidth+this.offsetLeft); }
		}
	}
	else if (this.top==null && this.left==null) {
		this.center();
	}
	else {
		if (this.top==null) { this.top=0; }
		if (this.left==null) { this.left=0; }
		this.div.style.top = this.top+this.offsetTop+"px";
		this.div.style.left = this.left+this.offsetLeft+"px";
	}

	// Re-position to make sure it stays on the screen
	if (this.constrainToScreen) {
		this.fitToScreen();
	}
};

// Append an object to the body
// --------------------------------------------------------------------
Popup.prototype.appendToBody = function(o) {
	var body = Screen.getBody();
	if (body && body.appendChild) {
		body.appendChild(o);
	}
};

// Create a new DIV object to be used for a popup
// --------------------------------------------------------------------
Popup.prototype.createDiv = function() {
	if (document.createElement) {
		var d = document.createElement("DIV");
		d.style.position="absolute";
		d.style.display="block";
		d.style.visibility="hidden";
		this.appendToBody(d);
		return d;
	}
	alert("ERROR: Couldn't create DIV element in Popup.prototype.createDiv()");
	return null;
};

// Create a new IFRAME object to be used behind the popup
// --------------------------------------------------------------------
Popup.prototype.createIframe = function() {
	if (document.createElement) {
		var i= document.createElement("IFRAME");
		i.style.position="absolute";
		i.style.display="block";
		i.style.visibility="hidden";
		i.style.background="none";
		this.appendToBody(i);
		return i;
	}
	else {
		alert("ERROR: Couldn't create IFRAME object in Popup.prototype.createIframe()");
	}
};

// Add an IFRAME shim for the DIV
// --------------------------------------------------------------------
Popup.prototype.addIframeShim = function() {
	if (this.iframe==null) {
		this.iframe = this.createIframe();
	}
	this.iframe.className = Popup.iframeClass;
	CSS.setStyle(this.iframe,'top',this.getTop()+"px");
	CSS.setStyle(this.iframe,'left',this.getLeft()+"px");
	CSS.setStyle(this.iframe,'width',DOM.getOuterWidth(this.div) + "px");
	CSS.setStyle(this.iframe,'height',DOM.getOuterHeight(this.div) + "px");
	CSS.setStyle(this.iframe,'zIndex',Popup.minZIndex++);
	CSS.setStyle(this.iframe,'opacity',0);
	CSS.setStyle(this.iframe,'visibility','visible');
	CSS.setStyle(this.iframe,'display','block');
};

// Create a "screen" to make a popup modal
// --------------------------------------------------------------------
Popup.prototype.addScreen = function() {
	if (this.screen==null) {
		this.screen = this.createDiv();
		this.screen.style.top="0px";
		this.screen.style.left="0px";
		this.screen.style.backgroundColor = this.screenColor;
		this.screen.className=Popup.screenClass;;
		CSS.setStyle(this.screen,"opacity",this.screenOpacity);
		this.screen.onclick = function(e) { Event.cancelBubble(Event.resolve(e)); }
	}
	if (this.screenIframeShim==null) {
		this.screenIframeShim = this.createIframe();
		this.screenIframeShim.style.top="0px";
		this.screenIframeShim.style.left="0px";
		this.screenIframeShim.className=Popup.screenIframeClass;
		CSS.setStyle(this.screenIframeShim,"opacity",0);
	}
	this.screen.style.width = Screen.getDocumentWidth()+"px";
	this.screen.style.height = Screen.getDocumentHeight()+"px";
	this.screenIframeShim.style.width = Screen.getDocumentWidth()+"px";
	this.screenIframeShim.style.height = Screen.getDocumentHeight()+"px";
	this.screenIframeShim.style.zIndex = Popup.minZIndex++;
	this.screenIframeShim.style.visibility="visible";
	this.screenIframeShim.style.display="block";
	this.screen.style.zIndex = Popup.minZIndex++;
	this.screen.style.visibility="visible";
	this.screen.style.display="block";
};

// Re-position the DIV so it stays on the screen
// --------------------------------------------------------------------
Popup.prototype.fitToScreen = function() {
	var width = DOM.getOuterWidth(this.div);
	var height = DOM.getOuterHeight(this.div);
	var top = this.getTop();
	var left = this.getLeft();

	var clientWidth = Screen.getViewportWidth();
	var clientHeight = Screen.getViewportHeight();

	var scrollLeft = Screen.getScrollLeft();
	var scrollTop = Screen.getScrollTop();

	if (top-scrollTop+height>clientHeight) {
		top = top - ((top+height) - (scrollTop+clientHeight));
		this.div.style.top = top + "px";
	}
	if (left-scrollLeft+width>clientWidth) {
		left = left - ((left+width) - (scrollLeft+clientWidth));
		this.div.style.left = left + "px";
	}
	if (top<scrollTop) {
		this.div.style.top=scrollTop+"px";
	}
	if (left<scrollLeft) {
		this.div.style.left=scrollLeft+"px";
	}
};

// Center the DIV object
// --------------------------------------------------------------------
Popup.prototype.center = function() {
	var left = DOM.getOuterWidth(this.div);
	var top = DOM.getOuterHeight(this.div);
	if (isNaN(left)) { left=0; }
	if (isNaN(top)) { top=0; }	
	var clientW = Screen.getViewportWidth();
	var clientH = Screen.getViewportHeight();
	if (clientW!=null && clientH!=null) {
		top = (clientH-top)/2;
		left = (clientW-left)/2;
	}
	top += Screen.getScrollTop();
	left += Screen.getScrollLeft();

	this.div.style.top = top+this.offsetTop+"px";
	this.div.style.left = left+this.offsetLeft+"px";
};

// ***************************
// Custom Map Controller
// Last Updated: 5/31/2013
// Requires Google Maps API v3
// ***************************

// Settings:

var _stateZoomLevel = 6;
var _cityZipZoomLevel = 10;
var _countryGeocodeRegions = "US,CA";

var _defaultMapOptions = { center: new google.maps.LatLng(39, -97), zoom: 4, mapTypeId: google.maps.MapTypeId.ROADMAP, streetViewControl: false, draggable: true };
var _markerIcon = { path: google.maps.SymbolPath.CIRCLE, scale: 4, strokeColor: "red" };
var _geocoder = new google.maps.Geocoder();
var _infoWindow = new google.maps.InfoWindow(); 

// Object definitions:

var Store = function(id, name, address, phone, storeLink, lat, lon) {
	this.id = id;
	this.name = name;
	this.address = address;
	this.phone = phone;
	this.storeLink = storeLink;
	this.coordinates = [lat, lon];
};

var State = function(code, lat, lon) {
	this.code = code;
	this.coordinates = [lat, lon];
};

// Helper functions:

var initNewDefaultMap = function(allStores, onMapBoundsChanged) {
	var newMap = new google.maps.Map(document.getElementById("map-canvas"), _defaultMapOptions);

	getStoreMarkerPairs(allStores, _markerIcon).forEach(function(storeMarkerPair) {
		storeMarkerPair[1].setMap(newMap);		
		google.maps.event.addListener(storeMarkerPair[1], 'click', function() { 
																		_infoWindow.close(); 
																		_infoWindow.setContent(getInfoWindowContent(storeMarkerPair[0])); 
																		_infoWindow.open(newMap, storeMarkerPair[1]) 
																	});
	});

	google.maps.event.addListener(newMap, 'bounds_changed', onMapBoundsChanged);

	return newMap;
};

var getStoreMarkerPairs = function(stores, markerIcon) {
	if (stores == null)
		return [];

	return stores.map(function(store) {
		return [store, 
				new google.maps.Marker({
					position: new google.maps.LatLng(store.coordinates[0], store.coordinates[1]),
					title: getStoreTitle(store),
					icon: markerIcon
				})];
	});
};

var getStoreTitle = function(store) {
	return store == null ? "" : store.name + "\n" + store.address;
};

// TODO: Consider moving HTML here to external file for ease of modification
var getInfoWindowContent = function(store) {
	return '<div class="infoWindowContent"><span class="infoWindowHeader">' + store.name + '</span><div class="infoWindowBody"><span class="infoWindowPhone">' 
		+ store.phone + '</span><span class="infoWindowAddress">' + store.address.replace('\n', '<br />') 
		+ '</span></div><div class="infoWindowFooter"><hr /><ul><li><a target="_blank" href="https://maps.google.com?daddr='
		+ encodeURIComponent(store.address.replace('\n', ' ')) + '">Get Directions</a></li><li><a href="'
		+ store.storeLink + '">More Info</a></li></ul></div></div>';
};

var setMapOptions = function(mapOptions) {
	_defaultMapOptions = mapOptions;
};

var setMarkerIcon = function(markerIcon) {
	_markerIcon = markerIcon;
};

var setMapDraggable = function(isDraggable) {
	_defaultMapOptions.draggable = isDraggable;
};

var findUserOn = function(map) {
	if (map != null) {
		var changeMapOnSuccess = function(position) {
			map.setCenter(new google.maps.LatLng(position.coords.latitude, position.coords.longitude));
			map.setZoom(_cityZipZoomLevel);
		};
		var changeMapOnError = function(positionError) {
			map.setCenter(_defaultMapOptions.center);
			map.setZoom(_defaultMapOptions.zoom);
		};

		if (navigator && navigator.geolocation)
			navigator.geolocation.getCurrentPosition(changeMapOnSuccess, changeMapOnError, { enableHighAccuracy: false, timeout: 5000 });
		else
			changeMapOnError();
	}
};	

// NOTE: 'area' is bounding box retrieved from maps API for specific coord.
// - filter collection of all store locations by checking each store location to see if its coord. 
// fit within bounding box, then return the filtered collection
var getStoresWithinArea = function(allStores, area) {
	if (allStores == null || area == null)
		return [];

	return allStores.filter(function(storeLocation) {
								return area.contains(new google.maps.LatLng(storeLocation.coordinates[0], storeLocation.coordinates[1]));
							});
};

var stateLocationsClicked = function(map, state) {
	if (map != null && state != null) {
		map.setCenter(new google.maps.LatLng(state.coordinates[0], state.coordinates[1]));
		map.setZoom(_stateZoomLevel);
	}				
};

var allLocationsClicked = function(map) {
	if (map != null) {
		map.setCenter(_defaultMapOptions.center);
		map.setZoom(_defaultMapOptions.zoom);
	}
};

var scrubEnteredLocation = function(location) {		
	return location == null ? "" : location.replace(/[^a-zA-Z0-9_\s]/gi, "");
};

// - scrub user entered location
// - perform google geocode request on location
// - if not valid, call parameter function with zero store locations, otherwise:
// - center and zoom to location
// - update visible locations by calling updateNearestLocations function with 
//   store collection found within the map's current bounding box
var searchLocation = function(map, allStores, location, updateNearestLocations) {
	_geocoder.geocode({'address': scrubEnteredLocation(location), 'region': _countryGeocodeRegions}, 
					function(results, status) {
						if (status == google.maps.GeocoderStatus.OK) {
								if (map != null) {
									map.setCenter(results[0].geometry.location);
									map.setZoom(_cityZipZoomLevel);

									updateNearestLocations(getStoresWithinArea(allStores, map.getBounds()));
								}
						} else {
							updateNearestLocations(getStoresWithinArea(allStores, null));
						}
					});
};

